import axios from 'axios';
import { useEffect, useState } from 'react';
import * as React from 'react';
import { useNavigate } from 'react-router-dom';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import InputBase from '@mui/material/InputBase';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import AccountCircle from '@mui/icons-material/AccountCircle';
import './Userportalpage.css';

function Userportalpage() {
  const [user, setUser] = useState('');
  const [personprofile, setPersonProfile] = useState([]);
  const [anchorEl, setAnchorEl] = useState(null);
  const [categoryOptions, setCategoryOptions] = useState([]);
  const [ProfileanchorEl, setProfileanchorEl] = useState(null);

  useEffect(() => {
    const authToken = localStorage.getItem('authToken');
    axios
      .get('http://127.0.0.1:8000/myapp/auth', {
        headers: {
          Authorization: `${authToken}`,
        },
      })
      .then((res) => {
        setUser(res.data.username); // Set the username in the state variable
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  useEffect(() => {
    axios
      .get('http://127.0.0.1:8000/myapp/category-options', {})
      .then((res) => {
        setCategoryOptions(res.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  const navigate = useNavigate();
  const profilenavigate = useNavigate();

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleProfileMenu = (event) => {
    setProfileanchorEl(event.currentTarget);
  };

  const handleProfileClose = () => {
    setProfileanchorEl(null);
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="open drawer"
            sx={{ mr: 2 }}
            onClick={handleMenuOpen}
          >
            <MenuIcon />
          </IconButton>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
          >
            welcome {user}
          </Typography>
          <div className="search">
            <div className="search-icon-wrapper">
              <SearchIcon />
            </div>
            <InputBase
              placeholder="Search…"
              inputProps={{ 'aria-label': 'search' }}
            />
          </div>
          <div className="profile-icon-wrapper">
            <IconButton
              size="large"
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleProfileMenu}
              color="inherit"
            >
              <AccountCircle />
            </IconButton>
            <Menu
              id="menu-appbar"
              anchorEl={ProfileanchorEl}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={Boolean(ProfileanchorEl)}
              onClose={handleProfileClose}
            >
              <MenuItem onClick={() => navigate('/profile')}>Profile</MenuItem>
              <MenuItem onClick={handleProfileClose}>My account</MenuItem>
              <MenuItem onClick={() => navigate('/')}>Logout</MenuItem>
            </Menu>
          </div>
        </Toolbar>
      </AppBar>
      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleMenuClose}
      >
        {Object.entries(categoryOptions).map(([key, value]) => (
          <MenuItem key={key} onClick={handleMenuClose}>
            {value}
          </MenuItem>
        ))}
      </Menu>
    </Box>
  );
}

export default Userportalpage;
